INSERT INTO `trollingobject` (`ID`, `COLLECTION_ID`, `OBJECT_IDENTIFIER`, `city`, `color`, `color_back`, `color_belly`, `color_class`, `color_contrast`, `color_side`, `date`, `description`, `favorite`, `lure_type`, `maker`, `model`, `name`, `nickname`, `invisible`, `notvisible`, `place`, `routefile`, `size`, `time_end`, `time_start`, `waypointfile`)
VALUES
	(28,10,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-04-27','27.4.2009. Ilta. Ei mitään. Palokkajärvi eteläranta sillanalus ja veneranta. Puolipilvistä. 17C. Tyyntä lopussa.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(29,10,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-04-29','29.4.2009. Ilta. Ei mitään. Jyväsjärvi moottoritien uimaranta, Rauhalahti laituri. Pilvessä. 5C. Navakka kylmä tuuli.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'20:00:00','17:00:00',NULL),
	(30,10,3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-01','1.5.2009. Ilta. 39cm hauki(rattln rap hopea). Jyväsjärvi Rauhalahti laituri(hauki), Koivurannan telakka, moottoritien uimaranta. Aurinkoista. 16C. Normaali tuuli.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'20:00:00','17:00:00',NULL),
	(31,10,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-02','2.5.2009. Ilta. 45cm/400g hauki(calico cat). Palokkajärvi eteläveneranta(hauki), sillanalus, Tyyppälänlahden pohjukka. Aurinkoista. 19C. Tyyni.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(32,10,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-03','3.5.2009. Ilta. Ei mitään. Leppävesi Mustalahti levähdysalue. Puolipilvistä. 16C. Tyyntä, lopussa heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,'20:00:00','17:00:00',NULL),
	(33,10,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-04','4.5.2009. Ilta. 57cm/900g(sini minnow), 37cm/300g(calico cat), 39cm(calico cat) hauet, CR pikkuhauki. Palokkajärvi Kaijalanniemi. Sadetta, sateen loppu, selkenevää. 9C. Heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(34,10,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-06','6.5.2009. Ilta. 50cm/600g(calico cat) hauki. Palokkajärvi Kaijalanniemi. Puolipilvistä ja sateen alussa tärppi. 8C. Heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(35,10,8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-08','8.5.2009. Ilta. Ei mitään. Päijänne keljonlahti, vesi sameaa. Aurinkoista. 16C. Normaali - navakka tuuli.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'13',NULL,NULL,'21:00:00','17:00:00',NULL),
	(36,10,9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-12','12.5.2009. Ilta. Ei mitään, ~500g hauki kävi esittäytymässä. Jyväsjärvi Pitkäruoho(tärppi), Samulinniemi, Rauhalahti laituri. Puolipilvistä alussa, selkeää lopussa. 9C. Navakkaa puuskittaista, lopussa normaalia tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'20:00:00','17:00:00',NULL),
	(37,10,10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-13','13.5.2009. Ilta. 42cm hauki(ahven minnow). Palokkajärvi Tyyppälänlahti, eteläveneranta(hauki). Puolipilvistä - pilvistä. 8C. Navakkaa tuulta, lopussa heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(38,10,11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-16','16.5.2009. Ilta. Ei mitään, hauet kutivat. Jyväsjärvi moottoritien ranta, Rauhalahti laituri, Pitkäruoho. Aurinkoista. 11C. Normaalia tuulta, lopussa tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'21:00:00','17:00:00',NULL),
	(39,10,12,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-20','20.5.2009. Ilta. Ei mitään, hauet kutivat. Palokkajärvi Kaijalanniemi, eteläveneranta. Puolipilvistä. 14C. Heikkoa tuulta, lopussa tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(40,10,13,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-21','21.5.2009. Keskipäivä. Ei mitään, mato-ongella särki kävi tärppäämässä. Palokkajärvi eteläveneranta. Puolipilvistä. 14C. Heikkoa tuulta ja tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'15:00:00','11:00:00',NULL),
