	(896,16,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-04-27','27.4.2009. Ilta. Ei mitään. Palokkajärvi eteläranta sillanalus ja veneranta. Puolipilvistä. 17C. Tyyntä lopussa.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(897,16,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-04-29','29.4.2009. Ilta. Ei mitään. Jyväsjärvi moottoritien uimaranta, Rauhalahti laituri. Pilvessä. 5C. Navakka kylmä tuuli.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'20:00:00','17:00:00',NULL),
	(898,16,3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-01','1.5.2009. Ilta. 39cm hauki(rattln rap hopea). Jyväsjärvi Rauhalahti laituri(hauki), Koivurannan telakka, moottoritien uimaranta. Aurinkoista. 16C. Normaali tuuli.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'20:00:00','17:00:00',NULL),
	(899,16,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-02','2.5.2009. Ilta. 45cm/400g hauki(calico cat). Palokkajärvi eteläveneranta(hauki), sillanalus, Tyyppälänlahden pohjukka. Aurinkoista. 19C. Tyyni.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(900,16,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-03','3.5.2009. Ilta. Ei mitään. Leppävesi Mustalahti levähdysalue. Puolipilvistä. 16C. Tyyntä, lopussa heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,'20:00:00','17:00:00',NULL),
	(901,16,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-04','4.5.2009. Ilta. 57cm/900g(sini minnow), 37cm/300g(calico cat), 39cm(calico cat) hauet, CR pikkuhauki. Palokkajärvi Kaijalanniemi. Sadetta, sateen loppu, selkenevää. 9C. Heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(902,16,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-06','6.5.2009. Ilta. 50cm/600g(calico cat) hauki. Palokkajärvi Kaijalanniemi. Puolipilvistä ja sateen alussa tärppi. 8C. Heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'20:00:00','17:00:00',NULL),
	(903,16,8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-08','8.5.2009. Ilta. Ei mitään. Päijänne keljonlahti, vesi sameaa. Aurinkoista. 16C. Normaali - navakka tuuli.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'13',NULL,NULL,'21:00:00','17:00:00',NULL),
	(904,16,9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-12','12.5.2009. Ilta. Ei mitään, ~500g hauki kävi esittäytymässä. Jyväsjärvi Pitkäruoho(tärppi), Samulinniemi, Rauhalahti laituri. Puolipilvistä alussa, selkeää lopussa. 9C. Navakkaa puuskittaista, lopussa normaalia tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'20:00:00','17:00:00',NULL),
	(905,16,10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-13','13.5.2009. Ilta. 42cm hauki(ahven minnow). Palokkajärvi Tyyppälänlahti, eteläveneranta(hauki). Puolipilvistä - pilvistä. 8C. Navakkaa tuulta, lopussa heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(906,16,11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-16','16.5.2009. Ilta. Ei mitään, hauet kutivat. Jyväsjärvi moottoritien ranta, Rauhalahti laituri, Pitkäruoho. Aurinkoista. 11C. Normaalia tuulta, lopussa tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2',NULL,NULL,'21:00:00','17:00:00',NULL),
	(907,16,12,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-20','20.5.2009. Ilta. Ei mitään, hauet kutivat. Palokkajärvi Kaijalanniemi, eteläveneranta. Puolipilvistä. 14C. Heikkoa tuulta, lopussa tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(908,16,13,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-21','21.5.2009. Keskipäivä. Ei mitään, mato-ongella särki kävi tärppäämässä. Palokkajärvi eteläveneranta. Puolipilvistä. 14C. Heikkoa tuulta ja tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'15:00:00','11:00:00',NULL),
	(909,16,14,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-24','24.5.2009. Ilta. Ei mitään. Palokkajärvi eteläveneranta. Puolipilvistä, ukonilma syntymässä. 12C. Normaalia tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(910,16,15,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-25','25.5.2009. Ilta. 2x ahven, lahna, paljon CR särkiä (mato-onki). Palokkajärvi eteläveneranta. Melko selkeä. 18C. Kohtalaista tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(911,16,16,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-28','28.5.2009. Ilta. Ahvenia ja särkiä CR (mato-onki), heittämällä ei mitään. Palokkajärvi eteläveneranta. Selkeästä sateeseen. 10-15C. Navakasta tyyneen.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(912,16,17,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-29','29.5.2009. Ilta. Ei mitään. Palokkäjärvi Kaijalanniemi. Selkeää. 20C. Kohtalaista ja heikkoa tuulta.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,'21:00:00','17:00:00',NULL),
	(913,16,18,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2009-05-30','30.5.2009. Ilta. Ei mitään. Myllyjärvi eteläinen ranta. Selkeää. 25-23C. Heikkoa tuulta ja tyyntä.\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,'23:00:00','17:00:00',NULL),
